long_desc.thetext:
I checked again with the latest TPTP builds for version 4.4.1 or 4.5, with these releases, the Agent at least doesn't exit anymore and the payload is accessible using the cmd.getElemList(). 
But this allows only simple name-value pairs (using a payload like <name>value</name>), any more detailed structured information is still not possible, the cmd.getCommandData() still returns an empty string.
Well, using at least the element list works for me so far, but the API is still not working as described. 

So whats still missing:
-access to attributes (<name attribute="attvalue">value</name>)
-access to complete command payload using getCommandData()
-ability to parse the command data to a dom-like structure so that x-path can be used, Example:
TPTPXMLParse parseObj = new TPTPXMLParse();
parseObj.setParser(cmd.getCommandData());
parseObj.getXPath(node, "//some/x/path");
